import Cards from "../cards";
import Burger from "../menuBurger";


function Home() {
  const veículo = [
    {
      nome: "Scania G500",
      ano: "2019",
      valor: "639.666,00"
    },
    {
      nome: "Scania G500 XT 8x4",
      ano: "2019",
      valor: "745.000,00"
    },
    {
      nome: "Scania G440 6x4",
      ano: "2019",
      valor: "745.000,00"
    },
  ]; 
  return (
    <>
      <Burger/>
      <Cards/>
    </>
  );
}
export default Home;
